import React, { useState } from 'react'
import AlertaSesion from '../AlertaSesion';

const BtnSesion = (props) => {
    
 
    const [modalShow, setModalShow] = useState(false);

    return (
        <>

           
                <button className={props.tipo} onClick={(e) =>{
                    e.preventDefault();
                    setModalShow(true)}}>{props.titulo} </button>

                <AlertaSesion
                    show={modalShow}
                    title='Debes tener una cuenta para realizar esta acciÃ³n!'  
                    onHide={() => setModalShow(false)}
                />


        </>);
}

export default BtnSesion;
